import React from 'react';
import Logo from '../../../utils/img/rsz_logo.jpg';
import { Grid } from 'semantic-ui-react';

const TopNavbar = () => {
	return (
		<Grid reversed='computer'>
			<Grid.Row style={{ backgroundColor: '#fff' }} columns={5}>
				<Grid.Column>
					<img src={Logo} alt='Logo' className='logo' />
				</Grid.Column>
				<Grid.Column>جلب رضایت شما</Grid.Column>
				<Grid.Column>اولین اولویت ماست</Grid.Column>
				<Grid.Column width={1} className='border'>
					عضویت
				</Grid.Column>
				<Grid.Column width={1} className='border'>
					ورود
				</Grid.Column>
			</Grid.Row>
		</Grid>
	);
};

export default TopNavbar;
